(18, 1, 'wp_yoast_notifications', 'a:6:{i:0;a:2:{s:7:"message";s:308:"The configuration wizard helps you to easily configure your site to have the optimal SEO settings.<br/>We have detected that you have not finished this wizard yet, so we recommend you to <a href="http://yush25um.bget.ru/wp-admin/?page=wpseo_configurator">start the configuration wizard to configure Yoast SEO</a>.";s:7:"options";a:8:{s:4:"type";s:7:"warning";s:2:"id";s:31:"wpseo-dismiss-onboarding-notice";s:5:"nonce";N;s:8:"priority";d:0.80000000000000004;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:14:"manage_options";s:16:"capability_check";s:3:"all";}}i:1;a:2:{s:7:"message";s:344:"Yoast SEO and WooCommerce can work together a lot better by adding a helper plugin. Please install Yoast WooCommerce SEO to make your life better. <a href="https://yoa.st/1o0?utm_content=6.0" aria-label="Больше информации о Yoast WooCommerce SEO" target="_blank" rel="noopener noreferrer">Больше информации</a>.";s:7:"options";a:8:{s:4:"type";s:7:"warning";s:2:"id";s:44:"wpseo-suggested-plugin-yoast-woocommerce-seo";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";a:1:{i:0;s:15:"install_plugins";}s:16:"capability_check";s:3:"all";}}i:2;a:2:{s:7:"message";s:557:"Yoast SEO and Advanced Custom Fields can work together a lot better by adding a helper plugin. Please install <a href="http://yush25um.bget.ru/wp-admin/update.php?action=install-plugin&amp;plugin=acf-content-analysis-for-yoast-seo&amp;_wpnonce=75b4d81c27">ACF Content Analysis for Yoast SEO</a> to make your life better. <a href="https://wordpress.org/plugins/acf-content-analysis-for-yoast-seo/" aria-label="Больше информации о ACF Content Analysis for Yoast SEO" target="_blank" rel="noopener noreferrer">Больше информации</a>.";s:7:"options";a:8:{s:4:"type";s:7:"warning";s:2:"id";s:41:"wpseo-suggested-plugin-yoast-acf-analysis";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";a:1:{i:0;s:15:"install_plugins";}s:16:"capability_check";s:3:"all";}}i:3;a:2:{s:7:"message";s:230:"Не пропустите свои ошибки индексирования: <a href="http://yush25um.bget.ru/wp-admin/admin.php?page=wpseo_search_console&tab=settings">подключитесь к Google Search Console здесь</a>.";s:7:"options";a:8:{s:4:"type";s:7:"warning";s:2:"id";s:17:"wpseo-dismiss-gsc";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";}}i:4;a:2:{s:7:"message";s:444:"У вас в WordPress, до сих пор установлено название сайта по умолчанию. Наверно лучше сделать его пустым, чем как сейчас. <a href="http://yush25um.bget.ru/wp-admin/customize.php?url=http%3A%2F%2Fmoskovst.by%2Fwp-admin%2Fpost.php%3Fpost%3D281%26action%3Dedit%26message%3D6"> вы всегда можете исправить его в настройщике </a>.";s:7:"options";a:8:{s:4:"type";s:5:"error";s:2:"id";s:28:"wpseo-dismiss-tagline-notice";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";}}i:5;a:2:{s:7:"message";s:392:"<strong>Серьёзная проблема для SEO: Вы блокируете доступ для поисковых роботов.</strong> Вы должны <a href="http://yush25um.bget.ru/wp-admin/options-reading.php">зайти в Настройки чтения</a> и убрать галочку рядом с пунктом "Видимость для поисковых систем".";s:7:"options";a:8:{s:4:"type";s:5:"error";s:2:"id";s:32:"wpseo-dismiss-blog-public-notice";s:5:"nonce";N;s:8:"priority";i:1;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";}}}'),
